import Dashboard from "./dashboard";
import Garage from "./carsList";
import Login from "./loginForm";
import './App.css'

function App() {
  let username = "jeeva"
  let password = 'jeeva123'
  let isLogin = false
  let isRegister = true
  if (isLogin) {
    return <Login />
  } else {
    if (isRegister) {
      return <Register />
    } else {
      return (<div>
        <Dashboard username={username} password={password} />
        <Garage />
      </div>)
    }
  }

}

export default App;
